import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'tachyons';
import Card from './Card';
import {robots} from './robots';
import {randomIndex} from './random';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    (
    <div>
    <Card id={robots[0].id} name={robots[0].name} email={robots[randomIndex()].email} />
    <Card id={robots[1].id} name={robots[1].name} email={robots[randomIndex()].email} />
    <Card id={robots[2].id} name={robots[2].name} email={robots[randomIndex()].email} />
</div>
)
, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
